// src/components/FoodSliderComponent.js
import React from 'react';
import styled from 'styled-components';
import foodData from '/foodData.js';

const SliderContainer = styled.div`
  padding: 20px;
`;

const Title = styled.h2`
  text-align: center;
`;

const Slider = styled.div`
  display: flex;
  overflow-x: auto;
`;

const SliderItem = styled.div`
  flex: 0 0 auto;
  margin-right: 20px;
  text-align: center;
`;

const SliderImage = styled.img`
  width: 100px;
  height: 100px;
  border-radius: 50%;
`;

const FoodSliderComponent = () => {
  return (
    <SliderContainer>
      <Title>Popular food items</Title>
      <Slider>
        {foodData.foodItems.map((food, index) => (
          <SliderItem key={index}>
            <SliderImage src={food.imageUrl} alt={food.name} />
            <p>{food.name}</p>
            <p>{food.cuisine}</p>
            <p>{food.price}</p>
            <p>{food.time}</p>
          </SliderItem>
        ))}
      </Slider>
    </SliderContainer>
  );
};

export default FoodSliderComponent;
